import { MenuProps, SECTION } from "../App";
import { HomeIcon } from "../icons/HomeIcon";

export default function SpellingBee({ section, setSection }: MenuProps) {
  return (
    <>
      <div className="home" onClick={() => setSection(SECTION.NONE)}>
        {HomeIcon}
      </div>
      <div className="board">
        <img src="./popmilo.HEIC" />
      </div>
    </>
  );
}
